(function() {
  'use strict';

  var CordovaCrazy = angular.module('Cordova', []);

  CordovaCrazy.factory('accelerometer', ['$timeout', function($timeout) {
    return {
      getCurrentAcceleration: function(onSuccess) {

        var acceleration = {
          x: Math.random() * 9.81,
          y: Math.random() * 9.81,
          z: Math.random() * 9.81,
          timestamp: (new Date()).getTime()
        };

        if (onSuccess) {
          $timeout(function() {
            onSuccess.call(null, acceleration);
          });
        }
      }
    };
  }]);

  CordovaCrazy.factory('geolocation', ['$timeout', function($timeout) {
    return {
      getCurrentPosition: function(onSuccess) {
        var position = {
          coords: {
            latitude:  Math.random() * 90,
            longitude: Math.random() * 180,
            altitude: 0,
            accuracy: 0,
            altitudeAccuracy: 0,
            heading: 0,
            speed: 0
          },
          timestamp: (new Date()).getTime()
        };

        if (onSuccess) {
          $timeout(function() {
            onSuccess.call(null, position);
          });
        }
      }
    };
  }]);

  CordovaCrazy.factory('camera', ['$timeout', function($timeout) {
    return {
      getPicture: function(onSuccess) {

        var image = '';

        if (onSuccess) {
          $timeout(function() {
            onSuccess.call(null, image);
          });
        }
      }
    };
  }]);

})();
